function ProductsList({ currentCollectionId, collectionsList }) {
  const navigate = useNavigate();
  const [isSelectEnabled, setIsSelectEnabled] = useState(false);
  const [selectedProducts, setSelectedProducts] = useState(new Map());
  const [search, setSearch] = useState("");

  const { isPending: isProductsLoading, data: products } = useGetProducts({
    collection: currentCollectionId,
  });

  const filteredProducts =
    products?.data.filter((prod) =>
      prod.name.toLowerCase().includes(search.toLowerCase())
    ) || [];

  const productSelectedHandler = (prod) => {
    setSelectedProducts((prev) => new Map(prev).set(prod.product_id, prod));
  };

  const productDeselectHandler = (prod) => {
    setSelectedProducts((prev) => {
      const newSet = new Map(prev);
      newSet.delete(prod.product_id);
      return newSet;
    });
  };

  const handleSelectAllProducts = () => {
    setSelectedProducts(
      new Map(filteredProducts.map((product) => [product.product_id, product]))
    );
  };

  const handleDeselectAllProducts = () => {
    setSelectedProducts(new Map());
  };

  const handleCancelSelection = () => {
    setIsSelectEnabled(false);
    handleDeselectAllProducts();
  };

  const isAllProductsSelected = filteredProducts.every((product) =>
    selectedProducts.has(product.product_id)
  );

  const renderSelectionButtons = () => {
    if (isSelectEnabled) {
      return (
        <Button
          onClick={
            isAllProductsSelected
              ? handleDeselectAllProducts
              : handleSelectAllProducts
          }
        >
          {isAllProductsSelected ? "Deselect All" : "Select All"}
        </Button>
      );
    }

    if (!isSelectEnabled)
      return <Button onClick={() => setIsSelectEnabled(true)}>Select</Button>;
  };

  useEffect(() => {
    handleCancelSelection();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [currentCollectionId]);
  return isProductsLoading ? (
    <PageLoader />
  ) : (
    <>
      <div style={{ ...style, marginTop: "20px" }}>
        <input
          type="search"
          onChange={(e) => setSearch(e.target.value)}
          placeholder="Search"
          style={{
            width: "50%",
            padding: "10px",
            border: "0",
            borderRadius: "20px",
          }}
        />
        <div style={buttonDivStyle}>
          {isSelectEnabled ? (
            <Button onClick={handleCancelSelection}>Cancel</Button>
          ) : (
            <Button
              onClick={() =>
                navigate(
                  `/products/addProduct?collection=${currentCollectionId}`
                )
              }
            >
              Add Product
            </Button>
          )}
          {renderSelectionButtons()}
        </div>
      </div>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr",
          gap: "10px",
          maxWidth: "300px",
        }}
      >
        {filteredProducts.map((product) => (
          <ProductCard
            key={product.product_id}
            product={product}
            selected={selectedProducts.has(product.product_id)}
            enabledSelection={isSelectEnabled}
            onProductSelected={productSelectedHandler}
            onProductDeselect={productDeselectHandler}
          />
        ))}
      </div>
      {isSelectEnabled && (
        <ProductsActions
          selectedProducts={selectedProducts}
          collectionsList={collectionsList}
          onActionSuccess={handleCancelSelection}
        />
      )}
    </>
  );
}

